import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const ImageSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Slider {...settings} className='m-6'>
      <div>
        <img src="/images/ayat.jpg" alt="Image 1" />
      </div>
      <div>
        <img src="/images/tsehay.jpg" alt="Image 2" />
      </div>
      <div>
        <img src="/images/vamos2.jpg" alt="Image 3" />
      </div>
      <div>
        <img src="/images/vamos.jpg" alt="Image 3" />
      </div>
      {/* Add more slides as needed */}
    </Slider>
  );
};

export default ImageSlider;
